import React from 'react';

import './filteringAndSorting.css';

const FilteringAndSorting = () => {

    return (
        <div>
            <details>
                <summary>type</summary>
                <div>
                    <input type="checkbox" name="game" />
                    <input type="checkbox" name="dlc" />
                    <input type="checkbox" name="bundle" />
                </div>
            </details>
        </div>
    )

}

export default FilteringAndSorting;
